export class TouristAttraction {
    constructor() {
        this.lista = [
            {
                img: "data:image/png;base64,",
                titulo: "Pão de Açúcar",
                descrição:
                    "Amet minim mollit non deserunt ullamco est sit ali…nt. Velit officia consece duis enim velit mollit.",
            },

            {
                img: "data:image/png;base64,",
                titulo: "Cristo Redentor",
                descrição:
                    "Amet minim mollit non deserunt ullamco est sit ali…nt. Velit officia consece duis enim velit mollit.",
            },

            {
                img: "data:image/png;base64,",
                titulo: "Ilha Grande",
                descrição:
                    "Amet minim mollit non deserunt ullamco est sit ali…nt. Velit officia consece duis enim velit mollit.",
            },

            {
                img: "data:image/png;base64,",
                titulo: "Centro Histórico de Paraty",
                descrição:
                    "Amet minim mollit non deserunt ullamco est sit ali…nt. Velit officia consece duis enim velit mollit.",
            },
        ];
        this.selectors();
        this.events();
        if (window.innerWidth > 1024) {
            this.addCarrosel();
        }
        this.mostrarCards();
    }

    selectors() {
        this.inputFile = document.querySelector(".parte01-imagem-input");
        this.inputTitulo = document.querySelector(".parte01-titulo-input");
        this.inputDescrição = document.querySelector(".parte01-descrição-texto");
        this.pictureImage = document.querySelector(".parte01-imagem-label");
        this.pictureImageTxt = "Imagem";
        this.pictureImage.innerHTML = this.pictureImageTxt;

        this.form = document.querySelector(".parte01-conteiner-form");

        this.cards = document.querySelector(".parte02-conteiner-list");
    }

    events() {
        this.inputFile.addEventListener("change", this.previewImage.bind(this), false);
        this.form.addEventListener("submit", this.addItemNaLista.bind(this));
    }

    // FUNÇÃO DO PREVIEW DA IMAGEM
    previewImage(event) {
        const inputTarget = event.target;
        const file = inputTarget.files[0];

        if (file) {
            const reader = new FileReader();

            reader.addEventListener("load", (e) => {
                const readerTarget = e.target;

                const img = document.createElement("img");
                img.src = readerTarget.result;
                img.classList.add("parte01-image-preview");

                this.pictureImage.innerHTML = "";
                this.pictureImage.appendChild(img);
            });

            reader.readAsDataURL(file);
        } else {
            this.pictureImage.innerHTML = pictureImageTxt;
        }
    }
    // FUNÇÃO DE ADICIONAR O ITEM NA LISTA
    addItemNaLista(e) {
        e.preventDefault();
        const imgTarget = this.pictureImage.children[0].src;
        const tituloTarget = e.target["titulo-form"].value;
        const descricaoTarget = e.target["descriçãoform"].value;

        if (imgTarget !== "") {
            const card = {
                img: imgTarget,
                titulo: tituloTarget,
                descrição: descricaoTarget,
            };
            this.lista.push(card);
            this.mostrarCards();
            this.resetInputs();
        }
    }
    // FUNÇÃO DE PEGAR A LISTA CRIADA E MOSTRAR NA TELA
    mostrarCards() {
        let estruturaCards = "";

        this.lista.forEach((card) => {
            estruturaCards += `
                <li class="parte02-list-card" data-test="item-list" >
                    <figure class="parte02-card-figure">
                        <img class="parte02-card-img" src="${card.img}" data-test="image-item-list" >
                        <figcaption class="parte02-card-figcaption">
                            <h2 class="parte02-card-titulo" data-test="title-item-list" >${card.titulo}</h2>
                                <p class="parte02-card-descrição" data-test="description-item-list" >${card.descrição} </p>
                        </figcaption>
                    </figure>
                </li>
                `;
        });

        if (window.innerWidth > 1024) {
            this.resetCarrosel();
        }

        this.cards.innerHTML = estruturaCards;

        if (window.innerWidth > 1024) {
            this.addCarrosel();
        }
    }
    // FUNÇÃO DE QUANDO DER SUBMIT APAGAR O QUE JÁ FOI ADICIONADO
    resetInputs() {
        this.pictureImage.innerHTML = "Imagem";
        this.inputTitulo.value = "";
        this.inputDescrição.value = "";
    }

    addCarrosel() {
        if (window.innerWidth > 1024) {
            $(".parte02-conteiner-list").slick({
                dots: true,
                slidesToShow: 4,
                slideToScroll: 1,
                infinite: false,
                arrows: true,
            });
        }
    }
    resetCarrosel(){
        $(".parte02-conteiner-list").slick('unslick');
    }
}
